import { Component } from '@angular/core';
import { ApiService } from './services/api.service';

@Component({
  selector: 'app-root',
  templateUrl: './app.component.html',
  styleUrls: ['./app.component.css']
})
export class AppComponent {
  title = 'ejemplo11-web';

  constructor(public service: ApiService) { }

  comando = "";

  Salir() {
    this.comando = "logout";
    this.service.postEntrada(this.comando).subscribe(async (res: any) => {
      alert(await res.result + "\n");
    });
  }
}
<nav class="navbar navbar-dark bg-dark fixed-top">
  <div class="container-fluid">
    <div class="float-left">
      <a class="navbar-brand" href="/inicio">Ejemplo 7: Frontend y Backend</a>
    </div>
    <div class="float-right">
      <button class="navbar-toggler" type="button" data-bs-toggle="offcanvas" data-bs-target="#offcanvasDarkNavbar"
        aria-controls="offcanvasDarkNavbar" style="margin-left: 20px;">
        <span class="navbar-toggler-icon"></span>
      </button>
      <div class="offcanvas offcanvas-end text-bg-dark" tabindex="-1" id="offcanvasDarkNavbar"
        aria-labelledby="offcanvasDarkNavbarLabel">
        <div class="offcanvas-header">
          <h5 class="offcanvas-title" id="offcanvasDarkNavbarLabel">Mostrar</h5>
          <button type="button" class="btn-close btn-close-white" data-bs-dismiss="offcanvas"
            aria-label="Close"></button>
        </div>
        <div class="offcanvas-body">
          <ul class="navbar-nav justify-content-end flex-grow-1 pe-3">
            <li class="nav-item">
              <a class="nav-link" aria-current="page"
                onclick=" window.open('https://github.com/AndresPontaza/MIA_D_LABORATORIO_S1_2024','_blank')">Repositorio de Github Andres Pontaza</a>
            </li>
          </ul>
        </div>
      </div>
    </div>
  </div>
</nav>

